import React from "react";
import "./App.css";

function Welcome() {
  return (
    <div>
      <h1>
        Winter has Cometh ... <br></br>
        <span className="got-font">Game of Thrones</span>
      </h1>
      <h3>This application uses</h3>

      <a href="https://thronesapi.com/api/v2/Characters">
        https://thronesapi.com/api/v2/Characters
      </a>
      <p>as an API.</p>
    </div>
  );
}

export default Welcome;
